//sc는 Spark Context의 약자이다. sc라는 변수는 클러스처 상에서 스파크 작업 실행을 관리하는 sparkContext 객체의 참조임을 이야기하고있다.
sc

//sc 즉, 스파크컨텍스트객체로 할수있는일은, sc는 스칼라객체이며 여러 메서드를 가지고있다.

//객체의 변수 이름에 .을 찍고 tab을 누르면 객체가 제공하는 메서드를 확인할 수 있다고 한다. 

//그중 (sc가 제공하는 많은 메서드 )에 자주 사용하는것은 RDD를 생성하는 메서드이다.


//RDD는 스파크에서  사용하는 기본 데이터단위이다.

//클러스터의 여러 노드에 분산할수있는 객체들의 컬렉션을 의미.

//RDD를 생성하는건 두가지방법이 있다고한다 1. SC를이용하여 외부데이터(HDFS, JDBC)를 출처로 RDD를 생성 2.기존에 존재하는 RDD를 필터링, 집계, 조인하는 등 가공하여 새로운 RDD를 생성하는것

//우리는 첫번째방법을 사용하는 거겠지

//HDFS에서 데이터를 사용하여 RDD생성하는 부분

//scala로만 짜보자
//scala예시
//RDD는 탄력적 분산 데이터셋이다
//RDD는 클러스터의 여러 노드에 파티션으로 나뉘어 분산된다.
//각 파티션은 RDD의 전체 데이터중 일부를 담는다.
//파티션은 스파크에서 병렬처리되는 단위이다.
//스파크 프레임워크는 한 파티션안의 객체들을 순차적으로 처리하고, 파티션단위로는 병렬로 처리한다.
//RDD를 생성하는 아주 간단한 방법은 로컬객체 컬렉션을 인수로 SparkContext의 parallelize메서드를 실행하는 것이다.

//parallelize의 첫번째 인수는 병렬처리하려는 객체 컬렉션
//parallelize의 두번째 인수는 파티션의 개수이다.
//파티션 내의 객체들에 연산을 수행할 때가 되면 스파크는 구동자 프로세스로부터 객체 컬렉션의 일부를 가져온다...


//textFile메서드는 로컬파일시스템에 접근할 수 있다.
//textFile메서드의 인수로 개별 파일 이름대신 디렉터리 이름을 입력하면 스파크는 그 디렉터리의 모든파일을 RDD의 구성 요소로 간주함.


//외부데이터(HDFS)를 참조하여 RDD를 생성해보자.
val carRDD = sc.textFile("hdfs:///CarAccident/Data/2017car.csv")
